Domenica pomeriggio del 1984, dal televisore a colori di casa un bambino aspettava che cominciasse DISCORING, trasmissione che mandava in onda le novit√† musicali del periodo, tra le tante, si diede spazio al video di un gruppo inglese che aveva per cantante un signore con due denti sporgenti e un paio di baffoni, il video era un alternarsi di immagini in bianco e nero prese da un film degli anni 20 del 1900 e altre a colori che riprendevano quattro tizi (il signore dai denti sporgenti e coi baffoni, un biondino e due coi cappelloni ricci....) che da un palco battevano le mani a tempo col pubblico.
Quella domenica pomeriggio del 1984, quel bambino scopr√¨ tre cose, che la canzone che gli aveva un titolo strano ma che gli piaceva, RADIO GA GA, la band si chiamava i QUEEN e soprattutto scopr√¨ l'immensa figura di FREDDIE MERCURY, il leader del gruppo.
